import React from "react"; 

function Result ({ result }) {
  return (
    <div className="result" style={{width: "150px", height: "230px"}}>
      <img alt="poster" src={result.Poster} style={{width: "150px", height: "230px"}} />
      <h3>{result.Title}</h3>
    </div>
  )

}

export default Result;
